def replacewave(wavenum, wave_data_f):
    wave_data_bytes = struct.pack('f'*2048, *wave_data_f)
    wave_data_str = base64.b64encode(wave_data_bytes).decode('ascii')

    l_keyframe = {}
    l_keyframe['position'] = 0
    l_keyframe['wave_data'] = wave_data_str

    l_keyframes = [l_keyframe]
    l_component = {}
    l_component['interpolation'] = 1
    l_component['interpolation_style'] = 1
    l_component['type'] = "Wave Source"
    l_component['keyframes'] = l_keyframes
    l_components = [l_component]
    l_wavetable = {}
    l_wavetable['author'] = ''
    l_wavetable['full_normalize'] = True
    l_wavetable['name'] = "noname"
    l_wavetable['remove_all_dc'] = True
    l_wavetable['version'] = "1.0.7"
    l_wavetable['groups'] = []
    l_group = {}
    l_group['components'] = l_components
    l_wavetable['groups'].append(l_group)

    vitaldata["settings"]["wavetables"][wavenum] = l_wavetable

def setvalue(name, value):
    global vitaldata
    vitaldata["settings"][name] = value

def setvalue_timed(name, value):
    global vitaldata
    vitaldata["settings"][name] = math.sqrt(pow(value, 0.5))

def set_modulation(num, src, dest, amt, power, bipol, byp, ster):
    global vitaldata
    vitaldata["settings"]["modulations"][num-1] = {"destination": dest, "source": src}
    vitaldata["settings"]["modulation_"+str(num)+"_amount"] = amt
    vitaldata["settings"]["modulation_"+str(num)+"_bipolar"] = bipol
    vitaldata["settings"]["modulation_"+str(num)+"_bypass"] = byp
    vitaldata["settings"]["modulation_"+str(num)+"_power"] = power
    vitaldata["settings"]["modulation_"+str(num)+"_stereo"] = ster

def set_lfo(num, num_points, points, powers, smooth, name):
    vitaldata["settings"]["lfos"][num-1] = {"name":name, "num_points":num_points, "points":points,"powers":powers,"smooth":smooth}

def cvpj_asdrlfo2vitalparams(plugindata):
    if 'asdrlfo' in plugindata:
        if 'volume' in plugindata['asdrlfo']:
            if 'envelope' in plugindata['asdrlfo']['volume']:
                asdrdata = plugindata['asdrlfo']['volume']['envelope']
                if 'predelay' in asdrdata: setvalue_timed('env_1_delay', asdrdata['predelay'])
                if 'attack' in asdrdata: setvalue_timed('env_1_attack', asdrdata['attack'])
                if 'hold' in asdrdata: setvalue_timed('env_1_hold', asdrdata['hold'])
                if 'decay' in asdrdata: setvalue_timed('env_1_decay', asdrdata['decay'])
                if 'sustain' in asdrdata: setvalue('env_1_sustain', asdrdata['sustain'])
                if 'release' in asdrdata: setvalue_timed('env_1_release', asdrdata['release'])
    del plugindata['asdrlfo']

def getdata():
    global vitaldata
    return json.dumps(vitaldata)